const ValidateTable = (props) => {
  let attributeRows = Object.keys(props.userDetails).flatMap((attributeName) => {
    return (
      <tr key={attributeName}>
        <td>{attributeName}</td> <td>{props.userDetails[attributeName]}</td>
      </tr>
    );
  });

  return (
    <div className="row">
      <table>{attributeRows}</table>
    </div>
  );
};

export default ValidateTable;
